	@Test
	public void testCreateStore_UTCID01() {
		
		// Set data test
		Address address = new Address();
		address.setId(2);
		City c = new City();
		District d = new District();
		d.setCity(c);
		SubDistrict sd = new SubDistrict();
		sd.setDistrict(d);
		address.setSubDistrict(sd);
		address.setAddressLine("Ha Bằng");
		address.setGPS_Lati("21.243124323");
		address.setGPS_Long("24.154353443");
		Store str = new Store();
		str.setId(1);
		str.setLocation(address);
		StoreDto sdto = new StoreDto();
		AddressDto adto = new AddressDto();
		adto.setId(1);
		sdto.setAddress(adto);
		// Mock
		Mockito.when(mapStructMapper.storeDtoToStore(sdto)).thenReturn(str);
		Mockito.when(addressService.mapAddress(adto)).thenReturn(address);
		Mockito.when(storeRepository.save(str)).thenReturn(str);
		
		// Call method
		Store sRes = storeServ.createStore(sdto);
		assertEquals(str.getId(), sRes.getId());
	}
	
