	@Test
	public void testUploadStoreImg_UTCID02() {
		
		// Set data test
		ImageDto idto = new ImageDto();
		idto.setId((long) 1);
		idto.setImageName("1.jpg");
		idto.setEncodedImage("");
		Store s = new Store();
		s.setId(1);
		// Mock
		Mockito.when(storeServ.getStoreById(idto.getId())).thenReturn(s);
		Mockito.when(amazonClient.uploadFile(idto)).thenReturn("112eais-1.jpg");
		Mockito.when(storeRepository.save(s)).thenReturn(s);
		
		// Call method
		Store scheck = storeServ.uploadStoreImg(idto);
		
	    //compare
	    assertEquals(s.getId(),scheck.getId());
		
	}

